import React from 'react'
import ProjectSummary from './ProjectSummary';


const PorjectList =(props)=> {
    console.log(props)
    return (
        <div className="project-list section"> 
           <ProjectSummary baslik="Yapay Zeka" tarih="28 Haziran 1997" yazaradi="Muhammet METİN"></ProjectSummary>
           <ProjectSummary baslik="Makine Öğrenmesi" tarih="23 Haziran 2001" yazaradi="Ophan PAMUK"></ProjectSummary>
           <ProjectSummary baslik="Çocuk Psikolojisi" tarih="12 Eylül 2019" yazaradi="Mustafa ATAŞ"></ProjectSummary>
           <ProjectSummary baslik="Anadolu Kartalları" tarih="6 Ocak 2012" yazaradi="Mustafa ÖZKAN"></ProjectSummary>
           <ProjectSummary baslik="Türkiye Tarihi" tarih="3 Haziran 1992" yazaradi="Ahmet TERKİN"></ProjectSummary>
        </div>
    )
}

export default PorjectList;
